import Home from "./pages/home/Home";
import Topbar from "./components/topbar/Topbar";
import Single from "./pages/single/Single";
import Write from "./pages/write/Write";
import Settings from "./pages/settings/Settings";
import Login from "./pages/login/Login";
import About from "./pages/about/About";
import Register from "./pages/register/Register";
import Wellness from "./pages/wellness/Wellness"; 
import Resources from "./pages/resources/Resources";
import { BrowserRouter as Router, Route } from "react-router-dom"; // Remove 'Switch'

function App() {
  // ... your code ...

  return (
    <Router>
      <TopBar />
      <Route exact path="/" component={Home} />
      <Route path="/register" render={() => (user ? <Home /> : <Register />)} />
      <Route path="/login" render={() => (user ? <Home /> : <Login />)} />
      <Route path="/write" render={() => (user ? <Write /> : <Register />)} />
      <Route path="/settings" render={() => (user ? <Settings /> : <Register />)} />
      <Route path="/wellness" render={() => (user ? <Wellness /> : <Register />)} />
      <Route path="/resources" component={Resources} />
      <Route path="/post/:postId" component={Single} />
    </Router>
  );
}

export default App;
